import React from "react";
import styled from "styled-components";
import { NavLink } from "react-router-dom";
import { Routes, Route } from "react-router-dom";

function Navbar() {
  return (
    <Container>
        <NavLink to='/' className='brand-name'>
          <ApexTitle>APEX</ApexTitle>_typer
        </NavLink>
        <Routes>
          <Route exact path='/' element={<NavLink to='/settings'><SettingsIcon src="icons/settings.png"/></NavLink>}/>
          <Route exact path='/settings' element={<CloseIcon src="icons/close.png"/>}/>
        </Routes>
    </Container>
  );
}

export default Navbar;

const Container = styled.div`

  .brand-name{
    font-size: 2em;
  }
`;

const ApexTitle = styled.span`
  color: #00ffff;
`;
